import React from 'react';
import {createMuiTheme, createStyles, makeStyles, Theme, ThemeProvider} from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import AppBar from '@material-ui/core/AppBar';
import CssBaseline from '@material-ui/core/CssBaseline';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import Summary from "../AccountSummary/summary";
import ExpandLess from '@material-ui/icons/ExpandLess';
import ExpandMore from '@material-ui/icons/ExpandMore';
import {Collapse, Icon, Link} from "@material-ui/core";
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import Home from "../Home/Home";
import data from "../../store/data"

const theme = createMuiTheme({
    palette: {
        primary: {
            light: '#5ee279',
            main: '#1aaf4b',
            dark: '#007e1d',
            contrastText: '#fff',
        },
        secondary: {
            main: '#1bb14c',
        },
    },
});
const drawerWidth = 270;

const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {
            display: 'flex',
            minHeight: '800px'
        },
        appBar: {
            zIndex: theme.zIndex.drawer + 1,
        },
        drawer: {
            width: drawerWidth,
            flexShrink: 0,
        },
        drawerPaper: {
            width: drawerWidth,
        },
        content: {
            flexGrow: 1,
            padding: theme.spacing(3),
        },
        toolbar: theme.mixins.toolbar,
        nested: {
            paddingLeft: theme.spacing(4),
        },
    }),
);

export default function ClippedDrawer() {
    const classes = useStyles();
    return (
        <div className={classes.root}>
            <ThemeProvider theme={theme}>
                <CssBaseline/>
                <Router>
                    <AppBar
                        position="fixed"
                        className={classes.appBar}
                    >
                        <Toolbar>
                            <Typography variant="h6" noWrap>
                                DV Bank
                            </Typography>
                        </Toolbar>
                    </AppBar>
                    <Drawer
                        className={classes.drawer}
                        variant="permanent"
                        classes={{
                            paper: classes.drawerPaper,
                        }}
                    >
                        <List>
                            <ListItem button component={props => <Link {...props} to='summary'/>}>
                                <ListItemIcon>
                                    <Icon>Home</Icon>
                                </ListItemIcon>
                                <ListItemText primary='Test Router'/>
                            </ListItem>
                            <ListItem button component={props => <Link {...props} to='summary'/>}>
                                <ListItemIcon>
                                    <Icon>Home</Icon>
                                </ListItemIcon>
                                <ListItemText primary='Test Router'/>
                            </ListItem>
                        </List>
                        <div className={classes.toolbar}/>

                    </Drawer>
                    <Switch>
                        <main className={classes.content}>
                            <div className={classes.toolbar}/>

                            <Route path="/usermenu/summary">
                                <Summary/>
                            </Route>
                            <Route path="/details">
                                <Home/>
                            </Route>

                        </main>
                    </Switch>
                </Router>
            </ThemeProvider>
        </div>
    );
}
